import { useLocation } from "react-router";
import { ArrowLeft  } from 'react-bootstrap-icons';
import { Link } from "react-router-dom";
import Card from 'react-bootstrap/Card';

import MainNavbar from '../MainNavbar.js';


function EventDetails() {

    const location = useLocation();
    const id = location.state.id;
    const urlName = location.state.urlName;
    const name = location.state.name;
    const date = location.state.date;
    const image = location.state.image;
    const description = location.state.description;

    return(
        <>
            <MainNavbar activeTab="/events"/>

            <div className="container section eventDetails">
                <div className="row">
                    <div className="col side-title">
                        <Link to="/events"><ArrowLeft size="16"/>Back</Link>
                        <div><h3>{name}</h3></div>
                        <hr/>
                    </div>
                </div>


                <div className="row">
                    <div className="col-4 eventImgContainer">
                        <div className="card">
                            <img src={image} className="card-img" alt={name}/>
                        </div>
                    </div>
                    <div className="col-8">
                        <Card>
                            <Card.Body><span className="medium p-4">Location:</span> orchjard road</Card.Body>
                        </Card>
                        <Card>
                            <Card.Body><span className="medium p-4">Location:</span> orchjard road</Card.Body>
                        </Card>
                    </div>
                </div>

            </div>
        </>
    );
}

export default EventDetails;
